import {Component} from "react";
import './style.css'

class Navbar extends Component {
    render() {
        return (
            <nav>
                <li>
                    <a href="https://github.com/MAA28">GitHub</a>
                </li>
                <li>
                    <a href="/">Blogs</a>
                </li>
                <li>
                    <a href="https://www.instagram.com/malteaschenbach/">Instagram</a>
                </li>
            </nav>
        );
    }
}

export default Navbar;
